class UploadHandler extends Component {
    parser = (event) => {
        const inventory = event.target.files[0]

        Papa.parse(inventory, {
            header: true,
            complete: function(results) {
                const items = results.data
                console.log(items)
            }
        })
    } // END parser
}

export default UploadHandler
